function ExpenseItem(props){
    const expenses = [
        {
          id: "e1",
          title: "Costco Gorcery",
          amount: 94.12,
          date: new Date(2020, 7, 14),
        },
        { id: "e2", 
          title: "Valentine's Gift", 
          amount: 799.49, 
          date: new Date(2021, 2, 12) },
        {
          id: "e3",
          title: "Car Insurance",
          amount: 294.67,
          date: new Date(2021, 5, 28),
        },
        {
          id: "e4",
          title: "New Monitor",
          amount: 450,
          date: new Date(2021, 10, 12),
        },
      ];
    return (
        <div>
            <div>title={expenses[0].title}</div>
            <div>amount={expenses[0].amount}</div>
            <div>date={expenses[0].date}</div>
            <div>title={expenses[1].title}</div>
            <div>amount={expenses[1].amount}</div>
            <div>date={expenses[1].date}</div>
            <div>title={expenses[2].title}</div>
            <div>amount={expenses[2].amount}</div>
            <div>date={expenses[2].date}</div>
        </div>
    );
}
